import React from "react";
import headerdemo from "../image/headerdemo.jpg"
const Headerdemo = () =>{
    return(

        <>
        <div>
            <img  src={headerdemo} alt="...." width="70" height ="70" />
            {/* <h1>own keeps</h1> */}
            <ul style={{width:"100%",height:"300px",float:"left",display:"flex"}}>
                <li>home</li>
                <li>contact us</li>
                <li>abouts us</li>
                <li>services</li>
            </ul>

        </div>
        </>

    );
};
export default Headerdemo;
